import React from 'react';

const YoutubeSync = () => {
  return (
    <div className="video" id="player">
      <iframe className="video" id="player" rel="0" width="640" height="360" src="https://www.youtube.com/embed/M7lc1UVf-VE?enablejsapi=1" />
    </div>
  )
};

export default YoutubeSync;
